//entry point of our app - where all app will be run
//react elements are simply objects
import React, {Component} from 'react'; 
import ReactDOM from 'react-dom';


const morningTasks = ['Brush teeth', 'Fix hair', 'Put on clothes', 'Feed cat', 'Pack lunch'];

class List extends Component {
    render() {
        //return react elements that should be displayed on UI
        return(
            <ol>
                {morningTasks.map((task, index) => <li key = {index}> {task} </li>)}
            </ol>)
    }
}

class Title extends Component {
    render(){
        return(
            <h1>Morning Routine</h1>
        )
    }
}

class Main extends Component {
    render(){
        return(
            <div>
                <Title/>
                <List morningTasks ={['Put on mascara', 'Cuddle the cat']}/>
                <List morningTasks={['Brush teeth', 'Fix hair', 'Put on clothes', 'Feed cat', 'Pack lunch']}/>
            </div>
        )
    }
}

ReactDOM.render(<Main/>, document.getElementById('root'));
